import React from "react";
import './App.css';
import Car from "./Car/Car";

function App() {

    const divStyle = {
        textAlign : 'center'
    }

    // eslint-disable-next-line no-unused-vars
    const state = {
        car: [
            {name: 'Ford', year: 2018},
            {name: 'Audi', year: 2016},
            {name: 'Mazda', year: 2010}
        ]
    }

    return (
        <div className="App" style={divStyle}>
            <h1>Hello world!</h1>
            <Car name={state.car[0].name} year={2018}/>
            <Car name={'Audi'} year={2016}/>
            <Car name={'Mazda'} year={2010}/>
        </div>
    );
}

export default App;
